import React from 'react';
import logo from './AppLab.png';
import './App.css';

function App() {
  return (
    <div>
      <div class="row">
        <div class="column">
          <h1> Welcome to the</h1>
          <img src={logo} className="App-logo" alt="logo" />
        </div>
        <div class="column">
          <button onclick="window.location.href='/check-in.js'">Check In</button>
          <a href="/check-in.js" class="button">Go to Google</a>
          <button type="button">Check Out</button>
        </div>
      </div>
    </div>
  );
}

export default App;
